import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuItem from '@mui/material/MenuItem';
import SvgIcon from '@mui/material/SvgIcon';
import Menu from '@mui/material/Menu';

// Icons
import HomeIcon from '@mui/icons-material/Home';
import SettingsIcon from '@mui/icons-material/Settings';

export function PillIcon(props) {
    return (
        <SvgIcon {...props}>
            <path d="M330.667,0c-37.042,0-71.875,14.427-98.042,40.615l-192,192C14.437,258.812,0,293.635,0,330.667
			c0,76.458,62.208,138.667,138.667,138.667c37.063,0,71.875-14.427,98.042-40.615l192-191.99
			c26.208-26.198,40.625-61.021,40.625-98.063C469.333,62.208,407.125,0,330.667,0z M149.875,213.875l-64,63.99
			C71.771,291.969,64,310.729,64,330.667c0,5.896-4.771,10.667-10.667,10.667c-5.896,0-10.667-4.771-10.667-10.667
			c0-25.646,9.979-49.75,28.125-67.885l64-63.99c4.167-4.167,10.917-4.167,15.083,0
			C154.042,202.958,154.042,209.708,149.875,213.875z M398.542,206.562l-88.457,88.447L174.332,159.241l88.46-88.46
			c18.125-18.135,42.229-28.115,67.875-28.115c52.938,0,96,43.063,96,96C426.667,164.312,416.688,188.427,398.542,206.562z"/>
        </SvgIcon>
    );
}

export default function MenuAppBar() {
    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleMenu = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    return (
        <Box sx={{flexGrow: 2}}>
            <AppBar position="static">
                <Toolbar>
                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="medications"
                        sx={{mr: 2}}
                    >
                        <PillIcon/>
                    </IconButton>

                    <IconButton
                        size="large"
                        edge="start"
                        color="inherit"
                        aria-label="menu"
                        sx={{mr: 2}}
                    >
                        <HomeIcon/>
                    </IconButton>

                    <Typography variant="h6" component="div" sx={{flexGrow: 1}}>
                        Help
                    </Typography>

                    <div>
                        <IconButton
                            size="large"
                            aria-label="account of current user"
                            aria-controls="menu-appbar"
                            aria-haspopup="true"
                            onClick={handleMenu}
                            color="inherit"
                        >
                            <SettingsIcon/>
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorEl}
                            anchorOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            open={Boolean(anchorEl)}
                            onClose={handleClose}
                        >
                            <MenuItem onClick={handleClose}>Profile</MenuItem>
                            <MenuItem onClick={handleClose}>My account</MenuItem>
                        </Menu>
                    </div>
                </Toolbar>
            </AppBar>
        </Box>
    );
}
